import React from 'react';
import { IAffilie } from '../../../app/models/affilie';
import { Document, Page, Text, View, StyleSheet} from '@react-pdf/renderer'
import { observer } from 'mobx-react-lite';


const PdfQp:  React.FC<{affilie: IAffilie }> = ({ affilie }) => {


    const borderColor = '#90e5fc'
    const styles = StyleSheet.create({
        container: {
            flexDirection: 'row',
            borderBottomColor: '#bff0fd',
            backgroundColor: '#bff0fd',
            borderBottomWidth: 1,
            alignItems: 'center',
            height: 24,
            textAlign: 'center',
            fontStyle: 'bold',
            flexGrow: 1,
        },
        description: {
            width: '60%',
            borderRightColor: borderColor,
            borderRightWidth: 1,
        },
        qty: {
            width: '10%',
            borderRightColor: borderColor,
            borderRightWidth: 1,
        },
        rate: {
            width: '15%',
            borderRightColor: borderColor,
            borderRightWidth: 1,
        },
        amount: {
            width: '15%'
        },
      }) ;


  return (
    <Document>
        <Page size="A4" style={styles.page}>

          <View style={styles.section}>
          <Text>{affilie.nom} {affilie.prenom}</Text>
          </View>
          <View style={styles.section}>
            <Text>Section #2</Text>
          </View>
        </Page>
      </Document>
  );


};

export default observer(PdfQp);
